package com.skyline.leetcode.solution;

/**
 * Implement strStr()
 * 
 * https://leetcode.com/problems/implement-strstr/
 * 
 * @author jairus
 *
 */
public class Q28 {

	public int strStr(String haystack, String needle) {
		if (haystack == null || needle == null) {
			return -1;
		} else if (needle.length() > haystack.length()) {
			return -1;
		} else if (needle.length() == 0 && haystack.length() == 0) {
			return 0;
		}
		for (int i = 0; i <= haystack.length() - needle.length(); i++) {
			int j = 0;
			for (; j < needle.length(); j++) {
				if (haystack.charAt(i + j) != needle.charAt(j)) {
					break;
				}
			}
			if (j == needle.length()) {
				return i;
			}
		}

		return -1;
	}

	public static void main(String[] args) {
		Q28 q = new Q28();
		System.out.println(q.strStr("mississippi", "issipidsadfsafdsaf"));
		System.out.println(q.strStr("1234", "12"));
		System.out.println(q.strStr("1234", "23"));
		System.out.println(q.strStr("1234", "34"));
		System.out.println(q.strStr("1234", "1234"));
		System.out.println(q.strStr("1234", "17"));
		System.out.println(q.strStr(
				"",
				"4"));
	}

}
